import React from "react";

function MovieList(props) {
  return (
    <div className="row_posters">
      {props.movies.map((movie, index) => (
        <div className="row_poster">
          <img src={movie.Poster} alt="movie"></img>
        </div>
      ))}
    </div>
  );
}

export default MovieList;
